state = {
  "year": 1800,
  "country": "SGN"
}

function updateDataDisplay() {
  $("#data-display").text("{");
  
  for (let year in land_data_by_year)
    $("#data-display").append('<br><b>"' + year + '"</b>: ' + JSON.stringify(land_data_by_year[year], null, 2) + ",");

  $("#data-display").append("}");
}

/////// CONTROLS

$("#hide_layout").click(function() {
  console.log($(this).prop("checked"));
  
  
  if ($(this).prop("checked")) {
    $("#led_layout").hide();
  } else {
    $("#led_layout").show();
  }
})
$("#hide_layout").click();

$("#copy_last_yr").click(function() {
  land_data_by_year[String(state.year)] = land_data_by_year[String(YEAR_REAL_ORDER[YEAR_REAL_ORDER.indexOf(state.year)-1])];

  $("#Y" + state.year + "_radio").click(); // cheap way to reload
})

$("#load_data_button").click(function() {
  try {
    land_data_by_year = JSON.parse($("#load_data_textbox").val());
    $("#load_data_textbox").val("good parse :3");
  } catch (error) {
    if (error instanceof SyntaxError) {
      $("#load_data_textbox").val("syntax error ya bum");
    } else {
      $("#load_data_textbox").val("unknown error >w< good luck");
    }
  }

  $("#Y" + state.year + "_radio").click(); // cheap way to reload
})

////// LEDS ON MAP

function onLEDClick() {
  elem = $(this);
  id = elem.attr("id").slice(1, -6);
  
  console.log(id + " " + elem.prop("checked"));
  
  if ($(this).prop("checked")) {
    $("#D" + id + "_label").text(state.country);
    $("#D" + id + "_label").removeClass("blink");
    
    land_data_by_year[String(state.year)][id-62] = state.country;
  } else {
    $("#D" + id + "_label").text("D" + id);
    $("#D" + id + "_label").addClass("blink");
    
    land_data_by_year[String(state.year)][id-62] = -1;

  }
  updateDataDisplay();
}

// div (id: D[lednum]_div, class: led)
//  checkbox (id: D[lednum]_check, value: D[lednum])
//  label    (id: D[lednum]_label, for: D[lednum])
function makeLEDbox(lednum) {
  html = "<div class=\"led\" id=\"D" + lednum + "_div\">" +
         "<input type=\"checkbox\" id=\"D" + lednum + "_check\" value=\"D" + lednum + "\">" +
         "<label for=\"D" + lednum + "\" id=\"D" + lednum + "_label\">D" + lednum + "</label>" +
         "</div>";

  $("#germany_leds").append(html);
  
  $("#D" + lednum + "_check").click(onLEDClick);
  
  $("#D" + lednum + "_div").css({ 
    position: "absolute",
    marginLeft: 0, marginTop: 0,
    top: LED_POSITIONS[lednum-1][1]/100000, left: LED_POSITIONS[lednum-1][0]/100000
  })
}


// germany leds
for (let i=62; i<=235; i++) {
  makeLEDbox(i);
}

/////// YEAR SELECT

function onYearClick() {
  elem = $(this);
  id = Number(elem.attr("id").slice(1, -6));
  
  for (let year of YEAR_LED_ORDER) {
    if (year == id) $("#" + year + "_img").show();
    else            $("#" + year + "_img").hide();
  }
  
  state.year = id;
  
  for (let lednum=62; lednum<=235; lednum++) {
    $("#D" + lednum + "_check").prop("checked", land_data_by_year[String(state.year)][lednum-62] == state.country);
    if (land_data_by_year[String(state.year)][lednum-62] == -1) {
      $("#D" + lednum + "_label").text("D" + lednum);
      $("#D" + lednum + "_label").addClass("blink");
    } else {
      $("#D" + lednum + "_label").removeClass("blink");
      $("#D" + lednum + "_label").text(land_data_by_year[String(state.year)][lednum-62]);
    }
  }
  
  console.log(id + " " + elem.prop("checked"));
}

// div (id: id_div, class: year_button)
//  radio    (id: Y[year]_radio, value: Y[id], name: yearselect)
//  label    (id: Y[year]_label, for: Y[year]_radio)
function makeYearButton(year, lednum) {
  html = "<div id=\"Y" + year + "_div\">" +
         "<input type=\"radio\" id=\"Y" + year + "_radio\" name=\"yearselect\" value=\"Y" + year + "\" />" +
         "<br>" +
         "<label for=\"Y" + year + "_radio\" id=\"Y" + year + "_label\">" + year + "</label>" +
         "</div>";
         
  $("#year_buttons").append(html);
  
  $("#Y" + year + "_radio").click(onYearClick);
  
  $("#Y" + year + "_div").css({ 
    position: "absolute",
    marginLeft: 0, marginTop: 0,
    top: LED_POSITIONS[lednum-1][1]/100000, left: LED_POSITIONS[lednum-1][0]/100000
  })
}

// years
for (let i=33; i<=61; i++) {
  year = YEAR_LED_ORDER[i-33]
  makeYearButton(year, i);
  if (year != 1800)
    $("#" + year + "_img").hide();
}

